    "2013-03-15T21:18:44.602634",nt"name": "attributes-for-mrb-e2rf1-catchments-by-major-river-basins-in-the-conterminous-united-states-norf8586",nt"isopen":
    false,nt"url": null,nt"notes": "This tabular data set represents the average
    normalized atmospheric (wet) deposition, in kilograms per square kilometer multiplied
    by 100, of Total Inorganic Nitrogen for the year 2002 compiled for every MRB_E2RF1
    catchment of selected Major River Basins (MRBs, Crawford and others, 2006). Estimates
    of Total Inorganic Nitrogen deposition are based on National Atmospheric Deposition
    Program (NADP) measurements (B. Larsen, U.S. Geological Survey, written. commun.,
    2007). De-trending methods applied to the year 2002 are described in Alexander and
    others, 2001. NADP site selection met the following criteria: stations must have
    records from 1995 to 2002 and have a minimum of 30 observations. The MRB_E2RF1 catchments
    are based on a modified version of the U.S. Environmental Protection Agency's (USEPA)
    ERF1_2 and include enhancements to support national and regional-scale surface-water
    quality modeling (Nolan and others, 2002; Brakebill and others, 2011). Data were
    compiled for every MRB_E2RF1 catchment for the conterminous United States covering
    New England and Mid-Atlantic (MRB1), South Atlantic-Gulf and Tennessee (MRB2), the
    Great Lakes, Ohio, Upper Mississippi, and Souris-Red-Rainy (MRB3), the Missouri
    (MRB4), the Lower Mississippi, Arkansas-White-Red, and Texas-Gulf (MRB5), the Rio
    Grande, Colorado, and the Great basin (MRB6), the Pacific Northwest (MRB7) river
    basins, and California (MRB8).",nt"license_title": null,nt"extras": [{ntt"key":
